import './ContactStyle.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faMapLocation, faPhoneAlt} from '@fortawesome/free-solid-svg-icons';
//npm install --save @fortawesome/free-brands-svg-icons
import {} from '@fortawesome/free-brands-svg-icons';

function Contact(){

    return(
        <center><div class="left-side">
        <div class="address details">
            <FontAwesomeIcon icon={faMapLocation} style={{color: "#ffffff",}} />
            <FontAwesomeIcon icon={faMapLocation} style={{color: "#ffffff",}} />
          {/* <i class="fas fa-map-marker-alt"></i> */}
          <div class="topic">Address</div>
          <div class="text-one">72/62 Devangar Pillayar Koil Street</div>
          <div class="text-two">Shevapet,Salem-636002</div>
        </div>
        <div class="phone details">
          <i class="fas fa-phone-alt"></i>
          <div class="topic">Phone</div>
          <div class="text-one">+91 99428 31878</div>
        </div>
        <div class="email details">
          <i class="fas fa-envelope"></i>
          <div class="topic">Email</div>
          <div class="text-one">dhanushkarthik8@gmail.com</div>
          <div class="text-two">20tucs034@skct.edu.in</div>
        </div>
      </div></center>
    );
}

export default Contact;
